import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element using a combination of class and text content
    const cartSelector = 'div.cart:has-text("Cart")';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.locator(cartSelector).click();

    // Wait for the cart modal to become visible. Based on CSS, it has a class 'modal' and 'cart-content'
    const modalSelector = 'div.modal-content:has(h2)';
    await page.waitForSelector(modalSelector, { state: 'visible', timeout: 5000 });

    // Take a screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract the title from the modal to verify it's the correct one
    const modalTitle = await page.locator(`${modalSelector} h2`).textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalTitle: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const screenshots = [];
    try {
        const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorPath });
        screenshots.push(errorPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
